const disArr= [{'task': 'program', 'days': '00','hours': '00', 'mins':'00'}, {'task': 'read', 'days': '00','hours': '00', 'mins':'00'}, {'task': 'write', 'days': '00','hours': '00', 'mins':'00'}, {'task': 'study', 'days': '00','hours': '00', 'mins':'00'}];

function Display(props){
  return(<div className='display'>
    <div>
      <select name='tasks' id='tasks'>
      {disArr.map( (item)=>(<option value={item['program']} >{item['program']}</option>) )}
      </select>
      <span className='time'>{props.time}</span>
    </div>
  </div>)
};
export default Display
